import logo from './logo.svg';
import './App.css';
import {Home} from './components/Home'
import {Department} from './components/Departments'
import {Employee} from './components/Employee'

function App() {
  return (
    <div className="App">
     <Home/>
     <Department/>
     <Employee/>
    </div>
  );
}

export default App;
